{
  "env": {
    "browser": true,
    "es6": true,
    "jquery": true
  },
  "globals": {
    "initial_data": true,
    "module": true,
    "_": true,
    "moment": true
  },
  "extends": "eslint:recommended",
  "parserOptions": {
    "ecmaFeatures": {
      "experimentalObjectRestSpread": true,
      "jsx": true
    },
    "sourceType": "module"
  },
  "plugins": ["react"],
  "rules": {
    "no-console": [0],
    "react/jsx-uses-vars": 1
  },
  "parser": "babel-eslint"
}

module.exports = {
  printWidth: 90,
}

module.exports = {
    "preset": 'ts-jest',
    "verbose": true,
    "testMatch": [__dirname  + '/gdbgui/src/js/tests/**'],
    "transform": {
      '^.+\.(j|t)sx?$': 'ts-jest'
    }
}

const tailwindcss = require("tailwindcss");
module.exports = {
  plugins: [tailwindcss("./tailwind.config.js"), require("autoprefixer")]
};

module.exports = {
  purge: ["./gdbgui/src/js/**", "./gdbgui/templates/*.html"],
  theme: {
    extend: {}
  },
  variants: {},
  plugins: []
};

{
  "env": {
    "browser": true,
    "es6": true,
    "jquery": true
  },
  "extends": ["tslint-config-prettier"],
  "globals": {
    "initial_data": true,
    "module": true,
    "_": true,
    "moment": true
  },
  "jsRules": {
    "indent": {
      "options": ["spaces"]
    }
  },
  "rules": {
    "quotemark": true,
    "semicolon": true
  }
}

const path = require("path");
const ForkTsCheckerWebpackPlugin = require("fork-ts-checker-webpack-plugin");

module.exports = {
  entry: {
    main: "./gdbgui/src/js/gdbgui.tsx",
    dashboard: "./gdbgui/src/js/dashboard.tsx"
  },
  devtool: "source-map",
  output: {
    path: path.resolve(__dirname, "gdbgui/static/js/")
  },
  module: {
    rules: [
      {
        test: /\.css$/,
        use: ["style-loader", "css-loader", "postcss-loader"]
      },
      {
        test: /\.(j|t)sx?$/,
        use: [
          {
            loader: "ts-loader",
            options: {
              experimentalFileCaching: true,
              experimentalWatchApi: true,
              transpileOnly: true
            }
          }
        ],
        exclude: /node_modules/
      }
    ]
  },
  plugins: [new ForkTsCheckerWebpackPlugin({})],
  resolve: {
    extensions: [".js", ".ts", ".tsx", ".css"]
  }
};
